    public String query;
    public long timestamp;

    public OnsiteAttributedData(String query, long timestamp) {
        this.query = query;
        this.timestamp = timestamp;
    }
}

public class TopFrequentQueries {
    public String query;

    public TopFrequentQueries(String query) {
        this.query = query;
    }
}
```

